// Team.js

import React from 'react';

const Team = () => {
  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>Meet Our Team</h1>
      <div style={styles.teamList}>
        <div style={styles.teamMember}>
          <h2 style={styles.name}>John Doe</h2>
          <p style={styles.role}>CEO & Founder</p>
        </div>
        <div style={styles.teamMember}>
          <h2 style={styles.name}>Jane Smith</h2>
          <p style={styles.role}>Lead Developer</p>
        </div>
        <div style={styles.teamMember}>
          <h2 style={styles.name}>Emily Johnson</h2>
          <p style={styles.role}>UI/UX Designer</p>
        </div>
        <div style={styles.teamMember}>
          <h2 style={styles.name}>Michael Brown</h2>
          <p style={styles.role}>Project Manager</p>
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    maxWidth: '800px',
    margin: '0 auto',
    textAlign: 'center',
    fontFamily: 'Arial, sans-serif',
  },
  heading: {
    fontSize: '2.5rem',
    color: '#333',
    marginBottom: '20px',
  },
  teamList: {
    display: 'grid',
    gridTemplateColumns: '1fr 1fr',
    gap: '20px',
  },
  teamMember: {
    backgroundColor: '#f5f5f5',
    padding: '15px',
    borderRadius: '8px',
  },
  name: {
    fontSize: '1.5rem',
    color: '#333',
  },
  role: {
    fontSize: '1rem',
    color: '#666',
  },
};

export default Team;
